import React from "react";
import axios from "axios";
import { Button } from 'semantic-ui-react'
import {Link, Route} from 'react-router-dom';
import GameDetail from "../../GameDetail/game-detail";
// import './game-cell.css'

function GameCell({game}){
    // var gameUrl = useRef()
    const gameAvaUrl = axios.defaults.baseURL + 'uploads/images/games/avatar/9.png';
    // gameUrl.current = game.Url
    // console.log(gameUrl)
    return (
        <Link to={'/game-detail/' + game.Url} component={() => <GameDetail game={game}/>} >
            <Button type="button">
                <a className="famous-game-link" href="/">
                    <img className="famous-game__img" src={gameAvaUrl} alt="Cannot get image" />
                    <div className="famous-game__name">{game.Title}</div>
                    <div className="famous-game__dev">Arcade games</div>
                </a>
            </Button>
        </Link>
    );
}

export default GameCell;
